import React from 'react';

const Playlist = ({ audioList, currentIndex, onAudioSelect }) => {
  return (
    <ul>
      {audioList.map((audio, index) => (
        <li key={index} onClick={() => onAudioSelect(index)}>
          {index === currentIndex ? <strong>{audio.title}</strong> : audio.title}
        </li>
      ))}
    </ul>
  );
};

export default Playlist;
